import React from 'react'
// import {Link} from "react-router-dom";




function CustomerDish({dish}) {

  document.querySelector(".btn-minus").setAttribute("disabled","disabled");

  //Taking value Increment and Decrement Counter
  var valueCount

  //Increment
  document.querySelector("btn-plus").addEventListerner("click",function(){

      //Assigning Value to the Counter
      valueCount=document.getElementById("count").value

      //Increment By 1
      valueCount++

      //Assign new value to the old one.
      document.getElementById("count").value=valueCount

   })


  return(
    <div>
        <div className="card dishes" style={{width: "300px"}}>
        <img src={`data:image/jpeg;base64,${dish.dish_img}`} className="card-img-top" alt="dish-img" />
        <div className="card-body">
          <h5 className="card-title">{`${dish.dish_name}`}</h5>
          <h5 className="card-text">{`${dish.dish_ingredients}`}</h5>
          <h5 className="card-text">{`${dish.dish_price}`}</h5>
          <h5 className="card-text">{`${dish.dish_description}`}</h5>
          <h5 className="card-text">{`${dish.dish_category}`}</h5>
          <button type="button" className="btn btn-outline-dark btn-plus" style={{borderRadius:"100%",width:"0.4px"}}>+</button>
          <span id="count">1</span>
          <button type="button" className="btn btn-outline-dark btn-minus disabled" style={{borderRadius:"100%",width:"0.4px"}}>-</button>
          <button type="button" className="btn btn-outline-success" style={{margin:"10px",borderRadius:"10%"}}>Add to Cart</button>
          </div>
          </div>
    </div>

  );
}



export default CustomerDish;
